import React from 'react';

export default class DefaultTree extends React.Component {
    constructor(props) {
        super(props);

        this.name = 'DefaultTree';
        this.key  = 'DEF';
    }

    performOperation(operation) {
        return operation;
    }

    preRender(operation) {
        return operation;
    }
    
    postRender(operation) {
        return operation;
    }

    getScaleFactor() {
        return 1;
    }

    Tree() {
        return null;
    }
}
